import React from "react";
import Lection from "./lection";
import Practice from "./practice";
import { Link } from "react-router-dom";

function index(){
    return(
        <div className={"main"}>
            <nav>
                <Link to={'/lection'}>Lection</Link>
                <Link to={'/practice'}>Practick</Link>
            </nav>
        </div>
    );
}

export default index;
